    let curChoice;
    if( curChoice == 'manager'){
        curChoice = 
        <div style={{display: 'flex', flexDirection:'column', justifyContent:'space-between'}}>
            <Button> View </Button>
            <Button> Edit </Button>
            <Button> Delete </Button>
        </div>
    }
  return (
    <div style={{backgroundColor: "#fafbfc"}}>
    </div>
  );
}

export default ChangingButtons;
